       setUsers({...users,[e.target.name]:e.target.value});
    }
const handleSubmit=(e)=>{
    e.preventDefault();
    console.log("users===",users);
    dispatch(createUser(users));
}
return (
<div>
    <form onSubmit={handleSubmit}>
    <lable>Name</lable>
    <input type='text' name='name' onChange={getUserData}/>
